import React, { Component } from 'react';
import styles from './Table.module.css';
import TableRow from '../TableRow';

class Table extends Component {
    constructor(props){
        super(props);
        this.state = {
            tableItems : []
        }
    }
    componentDidMount(){
        fetch('/api/alldreans')
            .then(res => res.json())
            .then(res => {
                this.setState({tableItems : res.dreans},()=>{
                    console.log("Table state : ",this.state.tableItems);
                });
            })
    }

    render() {
        return (
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Code Name</th>
                            <th>Description</th>
                            <th>Date</th>
                            <th>Guests</th>
                            <th>Need Things</th>
                            <th>Activity</th>
                        </tr>
                    </thead>

                    <TableRow codeName={items[0].codeName} description='Make some cool' date='22.04.2023'/>
                    <TableRow codeName={items[1].codeName} description='Meet with Pikachy' date='12.11.2021'/>
                </table>
            </div>
        )
    }
}
